import React, { useEffect } from 'react';
import { connect } from 'react-redux';
import { bindActionCreators } from 'redux';
import { getDataHome } from '../../redux-modules/modules/Home';
import Navigation from '../../components/navigation/Index';
import { IoIosHeartEmpty } from "react-icons/io";

const Home = (props) => {
    const { getDataHome } = props;
    useEffect(() => {
        getDataHome();
    }, [getDataHome])
    const { dataHome } = props;
    return (
        <div className="wrapper">
            <Navigation />
            <div className="home">
                <div className="d-flex margin-top-4">
                    <IoIosHeartEmpty className="fa fa-heart text-left" />
                    <span className="position-relative col-xs-6 col-sm-6 col-md-6 text-right">
                        <input
                            className="w-100"
                            autoComplete="off"
                            type="text"
                            placeholder="Cari siswa disini..."
                            name="search"
                        />
                        <i className="fa fa-search attendance__icon" />
                    </span>
                </div>
            </div>
        </div>
    );
}
const mapStateToProps = (state, props) => ({
    dataHome: state.home,
});

const mapDispatchToProps = dispatch => bindActionCreators({
    getDataHome,
}, dispatch);
export default connect(mapStateToProps, mapDispatchToProps)(Home);
